import React from 'react';
import { Route } from 'react-router-dom';


const Infobar = (props) => {
    return (
        <div>

                <Route path='/im/*' element={
                    <InboxContainer
                        store={props.store}
                    />
                } />
                <Route path='/user/*' element={
                    <ProfileContainer
                        store={props.store}
                    />
                } />
        </div>
    )
}

export default Infobar;
